func yyNextStep(id yyStateID, b byte) yyStateID {
	if mp, ok := yyTransitionTable[id]; ok {
		return mp[b]
	}

	return 0
}

type yyLexer struct {
	rs          io.ReadSeeker
	beginPos    int
	finPos      int
	currPos     int
	finRegexID  int
	currStateID yyStateID
	YYText      string
}

func New(rs io.ReadSeeker) *yyLexer {
	return &yyLexer{
		rs:          rs,
		beginPos:    0,
		finPos:      0,
		currPos:     0,
		finRegexID:  0,
		currStateID: 1, // init state id is 1.
	}
}

func (yylex *yyLexer) currByte() (byte, error) {
	b := make([]byte, 1)
	if _, err := yylex.rs.Read(b); err != nil {
		return 0, err
	}
	if _, err := yylex.rs.Seek(int64(yylex.currPos), io.SeekStart); err != nil {
		return 0, err
	}

	return b[0], nil
}

func (yylex *yyLexer) Next() (int, error) {
	yyEofCnt := 0
yystart:
	for {
		yyb, err := yylex.currByte()
		if err != nil {
			if errors.Is(err, io.EOF) {
				yyEofCnt++
				if yyEofCnt == 1 {
					goto finProcess
				}
			}
			return 0, err
		}
	finProcess:
		yyNxStID := yyNextStep(yylex.currStateID, yyb)
		if yyNxStID == 0 {
			yydata := make([]byte, yylex.finPos+1-yylex.beginPos)
			if _, err := yylex.rs.Seek(int64(yylex.beginPos), io.SeekStart); err != nil {
				return 0, err
			}
			if _, err := yylex.rs.Read(yydata); err != nil {
				return 0, err
			}
			yylex.YYText = string(yydata)
			YYText = yylex.YYText
			yyNewCurrPos := yylex.finPos + 1
			yylex.beginPos = yyNewCurrPos
			yylex.finPos = yyNewCurrPos
			yylex.currPos = yyNewCurrPos
			yylex.currStateID = 1

			regexID := yylex.finRegexID
			yylex.finRegexID = 0
			switch regexID {
			case 0:
				return 0, ErrYYScan
			case 1:
				{
					return Keyword, nil
				}
				goto yystart
			case 2:
				{
					return Type, nil
				}
				goto yystart
			case 3:
				{
					return Identifier, nil
				}
				goto yystart
			case 4:
				{
					return Digit, nil
				}
				goto yystart
			case 5:
				{
				}
				goto yystart
			case 6:
				{
					return LParen, nil
				}
				goto yystart
			case 7:
				{
					return RParen, nil
				}
				goto yystart
			case 8:
				{
					return LBracket, nil
				}
				goto yystart
			case 9:
				{
					return RBracket, nil
				}
				goto yystart
			case 10:
				{
					return Operator, nil
				}
				goto yystart
			case 11:
				{
				}
				goto yystart

			default:
				return 0, ErrYYScan
			}
		}
		if _, ok := yyFinStates[yyNxStID]; ok {
			yylex.finPos = yylex.currPos
			yylex.finRegexID = yyStateIDToRegexID[yyNxStID]
		}
		yylex.currStateID = yyNxStID
		yylex.currPos++
		if _, err := yylex.rs.Seek(int64(yylex.currPos), io.SeekStart); err != nil {
			return 0, err
		}
	}

	return 0, io.EOF
}

// This part is optional
func main() {
	program := `
func foo123bar() int {
    x := 1 * 10 + 123 - 1000 / 5432
    y := float64(x)

    return x + y
}
`
	fmt.Println(program)
	fmt.Println("-----------------")

	lex := New(bytes.NewReader([]byte(program)))
	for {
		n, err := lex.Next()
		if err != nil {
			if err == io.EOF {
				return
			}
			panic(err)
		}
		switch n {
		case Keyword:
			fmt.Println("Keyword")
		case Type:
			fmt.Println("Type")
		case Identifier:
			fmt.Println("Identifier")
		case Digit:
			fmt.Println("Digit")
		case Whitespace:
			fmt.Println("Whitespace")
		case LParen:
			fmt.Println("LParen")
		case RParen:
			fmt.Println("RParen")
		case LBracket:
			fmt.Println("LBracket")
		case RBracket:
			fmt.Println("RBracket")
		case Operator:
			fmt.Println("Operator")
		}
		fmt.Printf("\t %#v\n", lex.YYText)
	}
}
